import React ,{Component} from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
    render(){
        return (
            <nav class="navbar navbar-inverse">
                <div class="container-fluid">
                    <a class="navbar-brand" href="#">Title</a>
                    <ul class="nav navbar-nav">
                        <li class="active">
                            <a href="#">Home</a>
                        </li>
                        <li>
                            <a href="#">Link</a>
                        </li>
                    </ul>
                </div>
            </nav>
        );
    }
}

export default App;
